ぷるんと蒟蒻ゼリースタンディング　グレープ<br><br>

●蒟蒻粉配合で食感も楽しめる低カロリー(49kcal)で美味しいグレープ味のゼリーです。<br>
<br>



【お召し上がり方】<br>
・のどに詰まらせないよう、中身を押し出しながらよくかんでお召し上がりください。<br>
・冷やすとよりいっそう美味しく召し上がれます。<br><br>
<hr>

【名称】ゼリー飲料<br>
<br>


【原材料名】果糖ぶどう糖液糖、果汁（ぶどう、りんご）、還元水飴、砂糖、蒟蒻粉、酸味料、ゲル化剤（増粘多糖類）、香料、塩化カリウム、甘味料（アセスルファムＫ、スクラロース）、アントシアニン色素<br><br>
【内容量】130g × 8個<br><br>
【賞味期限】パッケージに記載<br><br>

【保存上の注意】<br>
・開封後は速やかにお召し上がりください。<br>
・お子様の手の届かないところに保管してください。<br><br>

【製造者】<br>
オリヒロブランデュ株式会社<br>
群馬県高崎市下大島町613<br><br>

【販売者】<br>
オリヒロ株式会社<br>
群馬県高崎市緑町4-5-20<br>
消費者相談室：0120-87-4970<hr>


